import { css } from "@emotion/css";
import Splashscreen from "./Pages/Splashscreen";

function App() {
  return (
    <div className={css`
      body{
        margin:0;
        padding:0;
        box-sizing:border-box;
      }
    `}>
      <Splashscreen />
    </div>
  );
}

export default App;
